import{withRouter} from 'react-router-dom';
import { Menu } from 'antd';

function SubNav(props){
    const currentPath = props.location.pathname
    console.log('currentpath',currentPath)
    // let pathHead  = currentPath.split("/").filter(i=>i)[0]
    const navList=props.urls.navList
    const handleClick = e => {
        console.log('click ', e);
        props.history.push(e.keyPath[0])
      };

    return(
        <div>
            <Menu mode="horizontal" onClick={handleClick} selectedKeys={currentPath} > 
             {
                 navList.map(item=>{
                     return(
                        <Menu.Item key={item.key} className="menuItem" > {item.title} </Menu.Item>
                     )
                 })
             }
        </Menu>
        </div>
        
    )
    


}


export default withRouter(SubNav)
